ga3h(){return"the Heavens and the Underworld"},
ga3j(){return"The Maya and Toltec vision of the world and the universe is revealed in their stone monuments and artistic works."},
ga3k(){return"UNESCO"},
ga38(){return"The site exhibits a multitude of architectural styles, reminiscent of styles seen in central Mexico and of the Puuc and Chenes styles of the Northern Maya lowlands."},
ga39(){return"The city comprised an area of at least 1.9 sq miles (5 sq km) of densely clustered architecture."},
ga3o(){return"\u201cAncient Maya 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga3g(){return"Map showing location of Chichen Itza in Yucat\xe1n State, Mexico."},
ga3c(){return'Chichen Itza was a powerful regional capital controlling north and central Yucat\xe1n. The earliest hieroglyphic date discovered at Chichen Itza is equivalent to 832 CE, while the last known date was recorded in the Osario temple in 998 CE.\nDominating the North Platform of Chichen Itza is the famous Temple of Kukulc\xe1n. The temple was identified by the first Spaniards to see it, as El Castillo ("the castle"), and it regularly is referred to as such.'},
ga3d(){return"The city was thought to have the most diverse population in the Maya world, a factor that could have contributed to this architectural variety."},
ga3a(){return"The structures of Chichen Itza were built from precisely chiseled limestone blocks that fit together perfectly without the mortar. Many of these stone buildings were originally painted in red, green, blue and purple colors depending on the availability of the pigments.\nThe stepped pyramid El Castillo stands about 98 feet (30 m) high and consists of a series of nine square terraces, each approximately 8.4 feet (2.57 m) high, with a 20 foot (6 m) high temple upon the summit."},
ga3b(){return"It was built upon broken terrain, which was artificially leveled to support structures such as the Castillo pyramid. Important buildings within the center were connected by a dense network of paved roads called sacbeob."},
ga3e(){return"Chichen Itza is located in the eastern portion of Yucat\xe1n state in Mexico. Nearby, four large sinkholes, called cenotes, could have provided plentiful water year round at Chichen, making it attractive for settlement."},
ga3f(){return'Of these cenotes, the "Cenote Sagrado" or Sacred Cenote, was used for the sacrifice of precious objects and human beings as a form of worship to the Maya rain god Chaac.'},
ga33(){return"Chichen Itza rises to regional prominence toward the end of the Early Classic period"},
ga34(){return"The earliest hieroglyphic date discovered at Chichen Itza"},
ga35(){return"Last known date recorded in the Osario temple"},
ga30(){return"Chichen Itza declines as a regional center"},
ga31(){return"Invaded by Spanish Conquistador Francisco de Montejo"},
ga32(){return"All Spanish are driven from the Yucat\xe1n Peninsula"},
ga3O(){return"Christ the Redeemer"},
ga3N(){return"A symbol of peace"},
ga3M(){return"Rio de Janeiro, Brazil"},
ga3y(){return"Brazil"},
ga3J(){return"A Perfect Union Between"},
ga3I(){return"Nature and Architecture"},
ga3K(){return"The statue looms large on the landscape, but it hides as much as it reveals about the diverse religious life of Brazilians."},
ga3L(){return"Thomas Tweed"},
ga3z(){return"The statue of Christ the Redeemer with open arms, a symbol of peace, was chosen."},
ga3A(){return"Construction took nine years, from 1922 to 1931, and cost the equivalent of US$250,000 (equivalent to $3,600,000 in 2020) and the monument opened on October 12, 1931."},
ga3P(){return"\u201cThe Majestic Statue of Christ the Redeemer - Seven Wonders of the Modern World - See U in History.\u201d Youtube, uploaded by See U in History / Mythology."},
ga3H(){return"Map showing location of Christ the Redeemer in Rio de Janeiro, Brazil."},
ga3D(){return"The placement of a Christian monument on Mount Corcovado was first suggested in the mid-1850s to honor Princess Isabel, regent of Brazil and the daughter of Emperor Pedro II, but the project was not approved.\nIn 1889 the country became a republic, and owing to the separation of church and state the proposed statue was dismissed."},
ga3E(){return'The Catholic Circle of Rio made a second proposal for a landmark statue on the mountain in 1920. The group organized an event called Semana do Monumento ("Monument Week") to attract donations and collect signatures to support the building of the statue. The organization was motivated by what they perceived as "Godlessness" in the society.\nThe designs considered for the "Statue of the Christ" included a representation of the Christian cross, a statue of Jesus with a globe in his hands, and a pedestal symbolizing the world.'},
ga3B(){return"Artist Carlos Oswald and local engineer Heitor da Silva Costa designed the statue. French sculptor Paul Landowski created the work. In 1922, Landowski commissioned fellow Parisian Romanian sculptor Gheorghe Leonida, who studied sculpture at the Fine Arts Conservatory in Bucharest and in Italy."},
ga3C(){return"A group of engineers and technicians studied Landowski's submissions and felt building the structure of reinforced concrete instead of steel was more suitable for the cross-shaped statue. The concrete making up the base was supplied from Limhamn, Sweden. The outer layers are soapstone, chosen for its enduring qualities and ease of use."},
ga3F(){return'Corcovado, which means "hunchback" in Portuguese, is a mountain in central Rio de Janeiro, Brazil. It is a 2,329 foot (710 m) granite peak located in the Tijuca Forest, a national park.'},
ga3G(){return"Corcovado hill lies just west of the city center but is wholly within the city limits and visible from great distances."},
ga3s(){return"Plans for the statue were first proposed by Pedro Maria Boss upon Mount Corcovado. This was never approved, however."},
ga3t(){return"A new plan was proposed by the Roman Catholic archdiocese, and after the citizens of Rio de Janeiro petitioned the president, it was finally approved."},
ga3u(){return"The foundation of the statue was ceremoniously laid out to commemorate Brazil\u2019s independence from Portugal."},
ga3v(){return"Construction officially began after the initial design was chosen via a competition and amended by Brazilian artists and engineers."},
ga3w(){return"Construction of the statue was completed, standing 98\u2019 tall with a 92\u2019 wide arm span."},
ga3x(){return"A chapel was consecrated at the statue\u2019s base to Our Lady of Aparecida to mark the statue\u2019s 75th anniversary."},
