ga48(){return"Roman"},
ga49(){return"Roman Empire"},
ga4k(){return"Still the Largest Standing"},
ga4j(){return"Amphitheater in the World Today"},
ga4l(){return"When falls the Coliseum, Rome shall fall; And when Rome falls - the World."},
ga4m(){return"Lord Byron"},
ga4a(){return"It was used for gladiatorial contests and public spectacles including animal hunts, executions, reenactments of famous battles, and dramas based on Roman mythology, and mock sea battles."},
ga4b(){return"It is the largest ancient amphitheater ever built, and is still the largest standing amphitheater in the world today, despite its age."},
ga4q(){return"\u201cAncient Rome 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga4i(){return"Map showing location of Colosseum in Rome, Italy,"},
ga4e(){return"The Colosseum is an oval amphitheater in the center of the city of Rome, Italy. Unlike Roman theaters that were built into hillsides, the Colosseum is an entirely free-standing structure."},
ga4f(){return"The building ceased to be used for entertainment in the early medieval era. By the late 6th century a small chapel had been built into the structure of the amphitheater, and the arena was converted into a cemetery. \nThe numerous vaulted spaces in the arcades under the seating were converted into housing and workshops, and are recorded as still being rented out as late as the 12th century."},
ga4c(){return"Construction began under the emperor Vespasian (r. 69-79 CE) in 72 and was completed in 80 CE under his successor and heir, Titus (r. 79-81). Further modifications were made during the reign of Domitian (r. 81-96).\nThe Colosseum is built of travertine limestone, tuff (volcanic rock), and brick-faced concrete. The outer wall is estimated to have required over 3.5 million cubic feet of travertine stone which were set without mortar; they were held together by 300 tons of iron clamps."},
ga4d(){return"It could hold an estimated 50,000 to 80,000 spectators at various points in its history, having an average audience of some 65,000."},
ga4g(){return'Following the Great Fire of Rome in 64 CE, Emperor Nero seized much of the destroyed area to build his grandiose Domus Aurea ("Golden House"). A severe embarrassment to Nero\'s successors, parts of this extravagant palace and grounds, encompassing 1 sq mile, were filled with earth and built over.'},
ga4h(){return"On the site of the lake, in the middle of the palace grounds, Emperor Vespasian would build the Colosseum as part of a Roman resurgence."},
ga46(){return"Colosseum construction was started during the Vespasian reign overtop what used to be a private lake for the previous four emperors. This was done in an attempt to revitalize Rome from their tyrannical reign."},
ga47(){return"The uppermost floor was built, and the structure was officially completed by Domitian."},
ga42(){return"The arena was repurposed as a fortress for the Frangipane and Annibaldi families. It was also at one point used as a church."},
ga43(){return"Pope Alexander VI permitted the site to be used as a quarry, for both storing and salvaging building materials."},
ga44(){return"Preservation of the colosseum officially began, after more than a millennia of dilapidation and vandalism. Pope Pius VIII was notably devoted to this project."},
ga45(){return"A restoration project was undertaken to ensure the colosseum remained a major tourist attraction for Rome. It currently stands as one of the greatest sources of tourism revenue in Italy."},
